import React from 'react';
import {AreaChart, Area} from 'recharts';

const ProgressChart = () => {

    const training = [
        {
            date: '20.12.2024',
            oneRM: 250,
            volume: 1240
        },
        {
            date: '22.12.2024',
            oneRM: 260,
            volume: 1140
        },{
            date: '24.12.2024',
            oneRM: 210,
            volume: 1540
        },{
            date: '25.12.2024',
            oneRM: 280,
            volume: 940
        },{
            date: '26.12.2024',
            oneRM: 290,
            volume: 900
        },{
            date: '27.12.2024',
            oneRM: 295,
            volume: 850
        },{
            date: '28.12.2024',
            oneRM: 200,
            volume: 2240
        },{
            date: '29.12.2024',
            oneRM: 180,
            volume: 2500
        },{
            date: '30.12.2024',
            oneRM: 180,
            volume: 2640
        }
    ];




  return (
    <AreaChart width={600} height={500} data={training}>
        <Area dataKey='oneRM'/>
        <Area dataKey='volume' />
    </AreaChart>
  )
}

export default ProgressChart
